import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="center">
        <h1 align="center"> URL Shortener </h1>
      </div>
      <div>
        <input id="url" type="text" placeholder="Enter URL" name="url" />
        <br/>
        <input id="submit" type="submit" className="btn"/>
      </div>
    </div>
  );
}

export default App;
